CREATE TABLE Book3(
   ID                INTEGER  NOT NULL PRIMARY KEY 
  ,Title             VARCHAR(255) NOT NULL
  ,Author1           VARCHAR(127)
  ,Author2           VARCHAR(96)
  ,Author3           VARCHAR(95)
  ,Publisher         VARCHAR(87)
  ,ISBN13            INTEGER  NOT NULL
  ,Date              DATE 
  ,Pages             INTEGER 
  ,ProductDimensions VARCHAR(30)
  ,SalesRank         INTEGER  NOT NULL
  ,RatingsCount      INTEGER 
  ,RatingValue       NUMERIC(3,1)
  ,PaperbackPrice    VARCHAR(7)
  ,HardcoverPrice    VARCHAR(7)
  ,EbookPrice        VARCHAR(7)
  ,AudiobookPrice    VARCHAR(6)
);
